import React, { useState, useEffect } from "react";
import ListShips from "../../services";

export default () => {
  const [ships, setShips] = useState([]);

  async function list() {
    await ListShips.get().then(result => setShips(result.results.results))
  }

  useEffect(() => {
    list()
  },[])

  return (
    <>
      <div>{ships}</div>
    </>
  );
};
